- input: TEXT,F3XA,,"This amendment is in response to the Commission's October 8 2003
    letter. In its letter the Commission directs the Committee to ensure that it files
    a separate Schedule C for each loan or line of credit and a separate Schedule
    C-1 each time a loan or line of credit is incurred or restructured or when a draw
    is made on a line of credit. Further the Commission directs the Committee to ensure
    that it provides it with a hard copy of the loan agreement and a Schedule C-1
    each time a loan or line of credit is incurred or restructured or when a draw
    is made on a line of credit. The Committee currently has a line of credit with
    M&T Bank; this report discloses the full amount drawn on the line at the end of
    the reporting period via Schedules C and it includes Schedules C-1 for all draws
    on the line made in this reporting period. The Committee is submitting (by hand
    delivery) hard copies of the loan agreement and Schedules C-1.  If the Commission
    has further questions please contact Andrew Goldberg at 202-321-1877.",
